import React, {Component} from 'react';
import api from '../../services/api';

export default class Main extends Component{

    loadProducts = async () => {
        var response = await api.get('/products');
        console.log(response);
    }


    componentDidMount(){
        this.loadProducts();
    }



    render(){
        return <h1> {response} </h1>
    }
}
